function BlackLineTitle(props) {
    let addClass = "";
    if (props.LightShade === true) {
        addClass = "LightGreenFontShade";
    }
    return(
        <h2 key={props.key} className={addClass+"LineTextLine CursiveFont MdFont"}>{props.Title}</h2>
    );
}

export default BlackLineTitle;
